import styles from "./../assets/components/Service.module.css";

function Service({
    nameService,
    logo,
}){

    function logoService(){
        switch(nameService){
            case("Spring"): {
                return <img src={logo} alt={logo} className={{width: 50, height: 50}}/>
            }   
                break;
            case("MongoDB"): {
                return <img src={logo} alt={logo} className={{width: 20, height: 50}}/>
            }   
                break;
        }
    }

    return (
        <div className={styles.containerService}>
            <div className={styles.title}>
              <p>{nameService}</p>  
            </div>
            {logoService()}
        </div>
    )
}

export default Service;
